import { ADD_TODO } from "../types";

const INITIAL_TODO = [
  {
    todo: {
      text: ""
    }
  }
];

export default function reducer(state = INITIAL_TODO, action) {
  switch (action.type) {
    case ADD_TODO:
      console.log(state);
    default:
      break;
  }
}
